  \"The status of geese and swans nesting on the coastal fringe of the Yukon Delta
  National Wildlife Refuge in 1982\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:01:59.601745\",\n\t\"name\": \"the-status-of-geese-and-swans-nesting-on-the-coastal-fringe-of-the-yukon-delta-national-wi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The major objectives of the refuge inventory
  program this spring were: 1) To describe spring weather and habitat condition and
  to document waterfowl migration; 2) To delineate the distribution and estimate the
  breeding populations of brant at three coastal locations; 3) To monitor subsistence
  activities and other predation at the brant colonies.; 4) To provide new index plots
  for cackling Canada geese as a basis for future comparisons of density and productivity
  over a wide geographic area on the refuge; 5) To measure factors affecting cackling
  Canada goose densities throughout the refuge, 6) To determine the average clutch
  size, clutch initiation dates and nesting success for brant, cackling Canada and
  emperor geese; 7) To census areas for which data on goose nesting density and nesting
  success; 8) To count broods of whistling swans.\",\n\t\"license_title\": \"License
